import React from "react";
import SwipeCards from 'react-native-swipe-cards';
import Card from './components/organisms/Card';
import NoMoreCards from './components/molecules/NoMoreCards';
import { View, Text } from "react-native";

import { useQuery } from "react-query";
import api from "../services/api"; // Your API function

const MainComponent = () => {
  const { isLoading, isError, data, error } = useQuery("data", api.fetchData);

  if (isLoading)
    return (
      <View>
        <Text>Loading...</Text>
      </View>
    );
  if (isError)
    return (
      <View>
        <Text>Error: {error.message}</Text>
      </View>
    );



    const handleYup = (card) => {
        console.log('Liked:', card);
      };

      const handleNope = (card) => {
        console.log('Disliked:', card);
      };

  return (
    <View style={{ flex: 1 }}>
      <SwipeCards
        cards={data}
        renderCard={(cardData) => <Card {...cardData} />}
        renderNoMoreCards={() => <NoMoreCards />}
        handleYup={handleYup}
        handleNope={handleNope}
      />
    </View>
  );
};

export default MainComponent;
